parseFileDates.code:
function parseFileDates(obj) {
	if(obj.image_info) {
		obj.image_info.datetime_original = iml.parseDate(obj.image_info.datetime_original);
	}
	if(obj.video_info) {
		obj.video_info.datetime_original = iml.parseDate(obj.video_info.datetime_original);
	}
   	obj.datetime_removed = iml.parseDate( obj.datetime_removed);
  	obj.datetime_stored = iml.parseDate(obj.datetime_stored);
   	obj.datetime_uploaded = iml.parseDate(obj.datetime_uploaded);
	return obj;
}
